  return (
    <div>
        <div className='Products bg-light p-3 '>
          <div className='p-3 d-flex'>
            <div className='w-50 p-2 bg-white m-2'>
              <Product
              id={12311}
              title={"footwear"}
              image={"footwear1.jpg"}
              rating={3}
              price={999}
              />
            </div>
            <div className='w-50 p-2 bg-white m-2'>
              <Product
              id={12321}
              title={"footwear"}
              image={"footwear2.jpg"}
              rating={3}
              price={870}
              />
            </div>
          </div>

          <div className='p-3 d-flex'>
            <div className='p-2 bg-white m-2'>
              <Product
              id={12331}
              title={"footwear"}
              image={"footwear3.jpg"}
              rating={2}
              price={879}
              />            
            </div>
            <div className='p-2 bg-white m-2'>
            <Product
              id={12341}
              title={"footwear"}
              image={"footwear4.jpg"}
              rating={5}
              price={1100}
              />            
              </div>
             <div className='p-2 bg-white m-2'>
              <Product
              id={12351}
              title={"footwear"}
              image={"footwear5.jpg"}
              rating={4}
              price={1300}
              />            
              </div>
          </div>

          <div className='p-3 '>
            <div className='p-2 bg-white m-2 d-flex justify-content-center'>
            <Product
              id={12361}
              title={"footwear"}
              image={"footwear6.jpg"}
              rating={1}
              price={1250}
              />            
              </div>
          </div>

        </div>
    </div>
  )
}

export default Footwears
